def _user_type(tags):
    user_type = 1
    if tags and 'getuirisk.white.2018041718.score' in tags and tags['getuirisk.white.2018041718.score'] <= 0.384:
        user_type = 5
    elif tags and 'getui.2018022816.probability(1-0)' in tags and tags['getui.2018022816.probability(1-0)'] >= 0.8328:
        user_type = 1
    return user_type

def _mapp_features(v):
    for feat, mapping in cat_val2idx_map.viewitems():
        idx = Feat2Index[feat]
        v[idx] = mapping[v[idx]]
    return v

def _user(v, default_ctr):
    if abs(v[2]) <= 1e-6 or abs(v[2]) > 10000:
        v[0] = 0
        v[1] = 0
        v[2] = default_ctr

        v[3] = 0
        v[4] = 0
        v[5] = default_ctr
        return v
    else:
        v[2] /=  10000.0
        v[5] /=  10000.0
        return v

def _item(v, default_ctr):
    if abs(v[0]) <= 1e-6 or abs(v[0]) > 10000:
        v[0] = default_ctr
        return v
    else :
        v[0] /= 10000.0
        return v

def _user_item(v, default_ctr):
    if abs(v[2]) <= 1e-6 or abs(v[2]) > 10000:
        v[0] = 0
        v[1] = 0
        v[2] = default_ctr
        return v
    else :
        v[2] /= 10000.0
        return v


def predict_proba(items):
    '''if MODEL PREPROCESS / FEATURE ENGINEERING required, write below before the "return ..." line. '''
    return clf.predict(items)

