@gen.coroutine
def PeriodcUpdate():
    redis = finup_model.get_redis()
    pp = finup_model.get_redis_pipeline()

    if not redis.is_connected():
        _ = yield redis.connect()

    global lpcode
    lpcode = yield redis.call('smembers', 'lpcode')

    _ = [pp.stack_call('GET', index) for index in lpcode]
    df = yield redis.call(pp)

    global loan_names
    loan_names = [item.split('|')[1] for item in df]
    global loan_id_name
    loan_id_name = {item.split('|')[1]: item.split('|')[0] for item in df}

PeriodvTime = 5 * 1000
PeriodicTask = ioloop.PeriodicCallback(PeriodcUpdate, PeriodvTime)
PeriodicTask.start()

@gen.coroutine
def process(req):
    items = req.data
    ret = items
    redis = finup_model.get_redis()

    if not redis.is_connected():
        _ = yield redis.connect()
    idx = -1
    for i in items:
        idx += 1
        usr_uniqueId = i["uuid"]
        # 判断用户类型
        t = i['tags']
        ret[idx]['user_type'] = _user_type(t)

        # 提取借款排序特征
        global lpcode
        lpcodes = i['loan_ids'].split(',') if 'loan_ids' in i and len(i['loan_ids'].strip()) > 0 else lpcode
        registered = 1 if 'user_id' in i and len(i['user_id'].strip()) > 0 else 0
        authorized = 1 if 'encryptDeviceNum' in i and len(i['encryptDeviceNum'].strip()) > 0 else 0
        channelId = int(t['channelId']) if t and 'channelId' in t and t['channelId'] in cat_val2idx_map['channelId'] else 0
        networkType = t['networkType'] if t and 'networkType' in t and t['networkType'] in cat_val2idx_map['networkType'] else 'wifi'
        pageId = int(t['pageId']) if t and 'pageId' in t and t['pageId'] in cat_val2idx_map['pageId'] else 1001
        position = 0
        loan_installed = set([loan_id_name[name] for name in loan_names if name in t['applist']]) if t and 'applist' in t else set()

        # redis 动态取数
        pp = finup_model.get_redis_pipeline()
        # 用户信息
        pp.stack_call("BITFIELD", usr_uniqueId, 'get', 'u32', '#0', 'get', 'u32', '#1', 'get', 'u32', '#2', 'get',
                      'u32', '#3', 'get', 'u32', '#4', 'get', 'u32', '#5', )
        # 商品信息
        for lp in lpcodes:
            # 只需要item_ctr
            pp.stack_call("BITFIELD", lp + '_', 'get', 'u32', '#2')

        # <用户,商品>交互信息
        for lp in lpcodes:
            # 只需要item_ctr
            pp.stack_call("BITFIELD", "{}_{}".format(usr_uniqueId, lp),
                          'get', 'u32', '#0',
                          'get', 'u32', '#1',
                          'get', 'u32', '#2')
        res = yield redis.call(pp)

        # 生成matrix
        matrix = np.zeros((len(lpcodes), len(Features)))
        for i in range(len(lpcodes)):
            rs = []
            rs.extend([channelId, networkType, pageId, position])
            rs.extend(_user(res[0], 0.1))
            rs.extend(_item(res[i+1], 0.1))
            rs.extend(_user_item(res[i+1+len(lpcodes)], 0.1))
            rs.extend([registered, authorized])
            rs.append(1 if lpcodes[i] in loan_installed else 0)
            matrix[i] = _mapp_features(rs)

        # 模型排序
        pred_result = list(zip(predict_proba(matrix), lpcodes))
        pred_result.sort(reverse=True)
        sorted_items = [itemId for score, itemId in pred_result]

        if ret[idx]['user_type'] == 5:
            sorted_items.remove('02')
            sorted_items.insert(0, '02')

        ret[idx]['loan_ids'] = ','.join(sorted_items)
    req.ret = ret




